import React, { useState } from 'react';
import axios from 'axios';
import './PremiumDonorForm.css';

const PremiumDonorForm = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    bloodType: '',
    latitude: '',
    longitude: '',
    age: '',
    address: '',
    phoneNumber: '',
    availabilityTime: '',
    DonorType: '',
    userUserName: '',
    userPassword: '',
    profilePicture: null,
  });

  const handleFileChange = (event) => {
    setFormData({
      ...formData,
      profilePicture: event.target.files[0],
    });
  };

  const handleChange = (event) => {
    setFormData({
      ...formData,
      [event.target.name]: event.target.value,
    });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      const formDataToSend = new FormData();

      for (const key in formData) {
        formDataToSend.append(key, formData[key]);
      }

      const response = await axios.post('/api/donors/register', formDataToSend);
      console.log(response.data);
    } catch (error) {
      console.error('Error submitting form:', error);
    }
  };

  return (
    <div>
      <h2>Register Premium Donor</h2>
      <form onSubmit={handleSubmit}>
        <label>
          First Name:
          <input type="text" name="firstName" value={formData.firstName} onChange={handleChange} />
        </label>

        <label>
          Profile Picture:
          <input type="file" accept="image/*" onChange={handleFileChange} />
        </label>

<label>
  Age:
  <input type="text" name="age" value={formData.age} onChange={handleChange} />
</label>
<label>
  Address:
  <input type="text" name="address" value={formData.address} onChange={handleChange} />
</label>
<label>
  Phone Number:
  <input type="text" name="phoneNumber" value={formData.phoneNumber} onChange={handleChange} />
</label>
<label>
  Availability Time:
  <input type="text" name="availabilityTime" value={formData.availabilityTime} onChange={handleChange} />
</label>
<label>
  Donor Type:
  <input type="text" name="DonorType" value={formData.DonorType} onChange={handleChange} />
</label>
<label>
  User Username:
  <input type="text" name="userUserName" value={formData.userUserName} onChange={handleChange} />
</label>
<label>
  User Password:
  <input type="password" name="userPassword" value={formData.userPassword} onChange={handleChange} />
</label>


        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default PremiumDonorForm;
